function Model(){var n=this;n.loaded=ko.observable(!0);n.address=ko.observable();n.result=ko.observable();n.inProgress=ko.observable(!1);n.captcha=ko.observable();n.disableSubmit=ko.computed(function(){return n.inProgress()||$.trim(n.address()).length!=34||n.captcha()==null});n.onSendClick=function(){n.inProgress(!0);n.result(null);$.post("api/Faucet/SendCoin",{address:n.address(),captcha:grecaptcha.getResponse()}).done(function(t){n.result({success:!0,transactionId:t.transactionId});n.address("")}).fail(function(t){var i=t.responseJSON,r=i&&i.errorMessage?t.errorMessage:"Sorry, an error occured. Please try again later.";n.result({success:!1,errorMessage:r})}).always(function(){n.captcha(null);grecaptcha.reset();n.inProgress(!1)})}}function captcha(n){model.captcha(n)}ko.punches.enableAll();var model=new Model;ko.applyBindings(model);